How do I pass a Mongoose Collection to a function in a js file?<p>I am working on a project where I want to be able to search a database of motorcycles based on a form input similar to what you would find on Revzilla.com after selecting My Garage at the top. This form will be used in multiple locations in the project.</p>
<p>I pass bikeLists to the index from my routes/index file</p>
<pre><code>
const express = require('express');
const router = express.Router();
const bikeDBModel = require('../models/bike')
const mongoose = require('mongoose');
const { collection } = require('../models/bike');

const BikesDBConnection = mongoose.connection.useDb('bikes')


router.get('/',(req,res)=&gt;{;
    const collection = BikesDBConnection.collection('harley-davidson')//Harley is the only Maker supported at the moment(change to all-bikes) soon.
    res.render('index', {'bikesList':collection})
});

module.exports = router;

</code></pre>
<p>and I can get it to show up on my view/index.ejs file</p>
<pre><code>
&lt;%= bikesList %&gt; 

