<p>Let us imagine I have the following document:</p>
<pre><code>{
   &quot;user_name&quot;: &quot;john doe&quot;
   &quot;friendsList&quot;: [
      {&quot;name&quot;: &quot;maria&quot;}, 
      {&quot;name&quot;: &quot;maria&quot;},
      {&quot;name&quot;: &quot;maria&quot;}
   ]
}
</code></pre>
<p>I would like to retrieve a document by <code>&quot;user_name&quot;: &quot;john doe&quot;</code> (it's unique), but only if all objects inside <code>friendsList</code> array have <code>name = maria</code>. In other words, the Document above would be returned, but the one represented below would result in <code>no matches</code>.</p>
