Mongoose save function not saving entire document<p>When I go to use <code>.save()</code> on a Mongoose Schema object, the object does not entirely get saved to the database - only certain parts of the JSON do.  Further, the return from the <code>.save()</code> does not match what is in the database.</p>
<pre><code>export const updateSWAMRequest = async (req, res) =&gt; { // remember, cannot add fields that aren't in model.
    const incomingData = req.body;

        console.log(&quot;-------------------------------------&quot;)
        console.log('incomingData from user :&gt;&gt; ', incomingData);
        //  { 
