        console.log(&quot;-------------------------------------&quot;)
        console.log('dataObj from DB :&gt;&gt; ', dataObj);
        //  { 
        //     Household: { reviewStatus: 'Approved' },
        //     Reevaluate: { A: 'bonnie' }
        //  }
        console.log(&quot;-------------------------------------&quot;)

        Object.keys(incomingData).forEach(key =&gt; {
            dataObj[key] = incomingData[key]
        })

        dataObj['Reevaluate'].test = &quot;111&quot;
        dataObj['Household'].test = &quot;111&quot;

        console.log(&quot;-------------------------------------&quot;)
        console.log('dataObj after Mods :&gt;&gt; ', dataObj);
        //  { 
        //     Household: { reviewStatus: 'Approved', test : 111 },
        //     Reevaluate: { A: 'alphie', test: 111 }
        //  }
        console.log(&quot;-------------------------------------&quot;)

        dataObj.save()
            .then((returnObj) =&gt; {
               console.log(&quot;-------------------------------------&quot;)
               console.log('returnObj :&gt;&gt; ', returnObj);
               //  { 
               //     Household: { reviewStatus: 'Approved', test : 111 },
               //     Reevaluate: { A: 'alphie', test: 111 }
               //  }
              console.log(&quot;-------------------------------------&quot;)
                return res.status(200).json({
                    success: true,
                    id: dataObj._id,
                    message: 'Data updated!!',
                })
            })
            .catch(error =&gt; {
                return res.status(409).json({
                    success: false,
                    error,
                    message: 'Request found, but not updated!',
                })
            })
    })
}
</code></pre>
<p>This is all basically exactly as I would expect -- the incoming data has been merged with the existing data that came from the database and the selectively changed 'test' items have been returned from the Mongoose <code>.save()</code> function.</p>
<p><strong>The problem is</strong>: that the database value after all of this running is:</p>
<pre><code>     { 
         Household: { reviewStatus: 'Approved'},
         Reevaluate: { A: 'bonnie', test: 111 }
     }
</code></pre>
<p>Only the top-level key that was sent with the <code>incomingData</code> object ends up making it to the database.  Any attempts to modify the <code>dataObj.Household</code> object don't go through.</p>
<p>I'm a bit at a loss -- as I though the whole point of <code>save()</code> was to take that object and save it to the DB and then return the new DB value.   ... it does not appear to be doing this.   I don't know where to look.</p>
<p>MyDataSchema is very simple:</p>
<pre><code>const Schema = mongoose.Schema

const MyDataSchema = new Schema(
    {
        &quot;_id&quot;: String,
        &quot;Reevaluate&quot;: {},
        &quot;Household&quot;: {},

    }, { timestamps: true }
)
export default mongoose.model('requests', MyDataSchema)  ///'requests' is the collection in the database
</code></pre>
<p>EDIT: further looking shows that if I replace <code>dataObj['Household'].test = &quot;111&quot;</code> with <code>dataObj['Household'] = {...dataObj['Household'], test : &quot;111&quot;}</code> then everything seems to work fine AND it gets saved to the DB.  I wonder if there is some higher-level key reference that isn't getting updated when the object contents are updated...</p>

