Ignore $in if empty array is provided<p>I have the following model:</p>
<pre><code>export type IMangaModel = Document &amp; {
  _id: string;
  title: string;
  description: string;
  demographic: Array&lt;string&gt;;
  genre: Array&lt;string&gt;;
  tags: Array&lt;string&gt;;
  related: Array&lt;IMangaModel&gt;;
  cover_image: {
    extraLarge: string | null;
    large: string | null;
    medium: string | null;
  };
  banner: string | null;
  al_id: number;
  al_url: string;
  likes: Array&lt;IUserModel['_id']&gt;;
};
</code></pre>
<p>Note: interface matches the model exactly but i pasted this as its much shorter.</p>
<p>I am using the following data to filter through this collection:</p>
<pre><code>includeFilters: {
    genres: Array&lt;string&gt;;
    tags: Array&lt;string&gt;;
    demographics: Array&lt;string&gt;;
  };
  excludeFilters: {
    genres: Array&lt;string&gt;;
    tags: Array&lt;string&gt;;
    demographics: Array&lt;string&gt;;
  };
</code></pre>
<p>What i want to achieve is to find every document and check if the corresponding array has at least one of the values from the array i sent via includeFilters. While it has none of the values sent via excludeFilters.</p>
<p>To do this i used the following query:</p>
<pre class="lang-js prettyprint-override"><code>const results = await this._manga
      .find(
        {
          tags: {
            $elemMatch: {
              $in: data.includeFilters.tags,
              $nin: data.excludeFilters.tags,
            },
          },
          genre: {
            $elemMatch: {
              $in: data.includeFilters.genres,
              $nin: data.excludeFilters.genres,
            },
          },
          demographic: {
            $elemMatch: {
              $in: data.includeFilters.demographics,
              $nin: data.excludeFilters.demographics,
            },
          },
        },
        { al_id: 1 }
      );
</code></pre>
<p>This seems to works fine <em>as long</em> as all of the arrays in includeFilters array have at least one value. But if an empty array is provided then no matches are found with $in, from what i understand $in requires at least one value to be present, but as nothing is provided then nothing is found. On the other hand, <strong>$nin</strong> works fine (at least i'd like to think so) because its not trying to exclude any values.</p>
<p>What i would like to achieve is that if an empty array is provided to $in then it outright just skips through that filter and doesnt look at it. When doing this in mysql if an empty array is provided then its ignored and every record is returned as a result. This is what i want with mongodb.</p>
<p>What i have tried till now are a couple of things.</p>
<p>First i tried to just add every possible value to array's that are empty, this did not work for one reason, not all documents have the tags,genres and demographic data. So in the end nearly 90% of all documents are not included in the result.</p>
<p>Second thing i tried was to enable the <strong>ignoreUndefined</strong> option in the connection options. And then when creating the query check if the length is 0, if it is, pass undefined to <strong>$in</strong>. This did not work.</p>
<p>Third thing i tried was going through every possible scenario where some array is empty, this was bad for obvious reasons so i scratched it.</p>
<p>Fourth thing i tried was to make a function to build a dynamic query of sorts, this also became very messy because of the amount of possibilities.</p>
<p>Fifth and last thing  i tried was using <strong>$or</strong> with the idea that the empty results would somehow be skipped.</p>

